  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0148756 includes physical
  and profile data collected aboard the Thomas Jefferson Launch 3101 and Thomas Jefferson
  Launch 3102 during project OPR-B370-TJ-15 in the North Atlantic Ocean from 2014-05-01
  to 2014-10-30. These data include CONDUCTIVITY, HYDROSTATIC PRESSURE, SALINITY,
  SOUND VELOCITY, WATER DENSITY and WATER TEMPERATURE. The instruments used to collect
  these data include CTD. These data were collected and submitted by the NOAA Office
  of Coast Survey in support of hydrographic multibeam surveys to meet NOAA charting
  requirements.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
